    struct OnboardingInformation {
        bytes32 node;
        Record record;
    }

    ENS ens;

    KomgoMetaResolver komgoMetaResolver;

    mapping(bytes32 => Record) companiesInformation;

    mapping(bytes32 => bool) companiesRegistered;

    bytes32[] public companiesNodes;

    constructor(address _ensAddress) public {
        ens = ENS(_ensAddress);
        // get meta resolver instance
        address resolverAddress = ens.resolver(KOMGO_META_RESOLVER_NODE);
        komgoMetaResolver = KomgoMetaResolver(resolverAddress);
    }

    function addCompanyOnboardingInformation(OnboardingInformation memory _onboardInformation) public returns(bool){

        bytes32 companyNode = _onboardInformation.node;
        require(companiesRegistered[companyNode] == false, "Company already added");
        //companiesInformation[companyNode].reverseNode = _onboardInformation.metaRecord.reverseNode;
        // companiesInformation[companyNode].jsonValues = _onboardInformation.record.jsonValues;
        uint256 numberOfKeys = _onboardInformation.record.ethPubKeys.length;
        for(uint256 i = 0; i < numberOfKeys; i++){
            companiesInformation[companyNode].ethPubKeys.push(_onboardInformation.record.ethPubKeys[i]);
        }
        companiesRegistered[companyNode] = true;
        companiesNodes.push(companyNode);
        return true;
    }

